	SET SQL_SAFE_UPDATES = 0;
	UPDATE tranh414_SVP.`System`
	SET tranh414_SVP.`System`.SourceBlock =   Substring(REGEXP_SUBSTR(tranh414_SVP.`System`.Properties, 'SourceBlock\\":\\"(.*?)\\"'),14)
